import './App.css';
import { useState } from 'react';
import data from './data';

function App() {

  const allNames = (data) => data.map((person) => <h1>{person.name}</h1>);
  const bornAfter1990 = (data) => data.map((person) => <h1>{person.name}</h1>);

  return (
    <div className='./App.css'>
      {allNames(data)}
    </div>

  );
}

export default App;
